import UrlRoute from "../helpers/UrlRouter.js";
import { api } from "./api";

const getDashboardStat = async () => {
  const response = await api.get(UrlRoute.dashboardStats);
  return response.data;
};

const dashboardService = {
  getDashboardStat,
};

export default dashboardService;
